import React from 'react'
import { makeStyles } from '@material-ui/core/styles';
import Hidden from '@material-ui/core/Hidden';
import Shipping from './static/shipping.png';

const useStyles = makeStyles((theme) => ({
	 mainbox : {
	  margin : 'auto',
	  width : '100%',
	  height : '600px',
	  border : '1px solid', 
	  paddingRight : '60px'
	},
	mobilebox : {
	  margin : 'auto',
	  width : '100%',
	  height : '560px',
	  border : '1px solid', 
	  padding : '60px'
	},


})
);

function Checkout(){
	const classes = useStyles();
	document.body.style = 'background: #B0DFE5;';
	return(
		<>
		 <Hidden xsDown>
			<div className={classes.mainbox} >
		    	<img src={Shipping} alt='Shipped' style={{position : 'absolute', top : '40%', left : '40%'}}/>
		        <br/>
		        <br/>

		    	<p style={{fontSize : '34px', color : 'white', position : 'absolute', top : '43%', left : '26%', paddingRight : '100px', lineHeight : '1.4'}}>Order #3321 has been shipped</p>
		    </div>
		  </Hidden>

		  <Hidden smUp>

		  	<div className={classes.mobilebox}>
		    	<img src={Shipping} alt='Shipped'/>
		    	<br/>
		    	<br/>
		        <br/>

		    	<p style={{fontSize : '25px', color : 'white'}}>Your order has been shipped #</p>
		    </div>
		  </Hidden>
		 </>
		);
}

export default Checkout
